#include <cstdint>
#include <unordered_map>
#include <set>

typedef uint64_t obj_id_t;

// GDSF-like: Frequency/size-aware eviction policy with GDSF priority and eviction history ("L" value).
class CacheManager {
private:
    struct PQNode {
        double priority;      // GDSF: L + freq/size
        uint64_t timestamp;   // For tiebreaking (FIFO among equals)
        obj_id_t obj_id;
        PQNode(double pri, uint64_t ts, obj_id_t id) : priority(pri), timestamp(ts), obj_id(id) {}
        bool operator<(const PQNode& o) const {
            if (priority != o.priority) return priority < o.priority;
            if (timestamp != o.timestamp) return timestamp < o.timestamp;
            return obj_id < o.obj_id;
        }
    };

    struct CacheEntry {
        uint64_t freq;
        uint64_t size;
        std::set<PQNode>::iterator pq_it;
    };

    std::unordered_map<obj_id_t, CacheEntry> table;
    std::set<PQNode> pq;
    double last_L = 0.0;
    uint64_t req_counter = 0;

    // GDSF priority: L + freq / size (scaled)
    double calc_priority(uint64_t freq, uint64_t size) {
        if (size == 0) return last_L + freq * 1e6;
        return last_L + (double(freq) * 1e6 / double(size));
    }

public:
    bool find(obj_id_t obj_id) {
        auto it = table.find(obj_id);
        if (it == table.end()) return false;
        CacheEntry& entry = it->second;
        pq.erase(entry.pq_it);
        entry.freq += 1;
        double pri = calc_priority(entry.freq, entry.size);
        PQNode n(pri, ++req_counter, obj_id);
        auto pit = pq.insert(n).first;
        entry.pq_it = pit;
        return true;
    }

    void insert(obj_id_t obj_id, uint64_t obj_size) {
        auto it = table.find(obj_id);
        if (it != table.end()) {
            find(obj_id);
            return;
        }
        uint64_t freq = 1;
        double pri = calc_priority(freq, obj_size);
        PQNode n(pri, ++req_counter, obj_id);
        auto pit = pq.insert(n).first;
        table[obj_id] = {freq, obj_size, pit};
    }

    obj_id_t evict() {
        if (pq.empty()) return 0;
        auto it = pq.begin();
        obj_id_t victim = it->obj_id;
        last_L = it->priority;
        pq.erase(it);
        table.erase(victim);
        return victim;
    }
};
